import Vue from 'vue';
import Router from 'vue-router';
import Createdata from './views/Createdata.vue';


Vue.use(Router);

export default new Router({
  routes: [

    {
      path: '/create',
      name: 'Createdata',
      component: Createdata,
    },
  ],
});
